import NavbarComponent from "../navbar";

function CustomerDashboard(){
    return(
        <div>
           <NavbarComponent />
           <h1>Welcome to INFOLIBRA
           <p>Here is your welcome message or any additional content.</p>
                <img
                  src="path/to/your/image.jpg" // Set the path to your image
                  alt="Welcome Image"
                  style={{ width: '100%', height: 'auto' }}
                />
           </h1>
        </div>
    )
    
}
export default CustomerDashboard;
